import React from "react";
import "./Task.scss";
import { Draggable } from "react-beautiful-dnd";

export default function Task(props) {
  return (
    <Draggable draggableId={props.task.id} index={props.index}>
      <div className="content">{props.task.content}</div>;
    </Draggable>
  );
}
